using System;\nusing System.Web;\n\npublic class SessionModule : IHttpModule\n{\n    public void Init(HttpApplication context)\n    {\n        // Attach to the Session_Start event.\n        context.Session_Start += OnSessionStart;\n        \n        // Attach to the Session_End event.\n        context.Session_End += OnSessionEnd;\n    }\n\n    private void OnSessionStart(object sender, EventArgs e)\n    {\n        // Your session start logic here\n        System.Diagnostics.Debug.WriteLine("Session started");\n    }\n\n    private void OnSessionEnd(object sender, EventArgs e)\n    {\n        // Your session end logic here\n        System.Diagnostics.Debug.WriteLine("Session ended");\n    }\n\n    public void Dispose()\n    {\n        // Clean-up code if necessary\n    }\n}